import axios from "axios";

async function GetInItSateRedux() {
  const reduxDataObj = (await axios.get("https://reqres.in/api/unknown/2"))
    .data;
  const reduxData = {
    data: {
      color: "#C74375",
      id: reduxDataObj.data.id,
      name: reduxDataObj.data.name,
      pantone_value: reduxDataObj.data.pantone_value,
      year: reduxDataObj.data.year,
    },
    support: { url: reduxDataObj.support.url, text: reduxDataObj.support.text },
  };
  console.log(reduxData);
  return reduxData;
}

// Tạo 1 công nhân reduce với tham số là action và state - state của redux ko phải react, hash code state bằng giá trị initState
const rootReducer = (state = GetInItSateRedux(), action) => {
  return state;
};
export default rootReducer;
